import React, { Component } from "react";
import { observer } from "mobx-react";

@observer
class TodoList extends Component {
  render() {
    const { todos } = this.props.store;
    const todoLists = todos.map((todo) => <li>{todo}</li>);
    return (
      <div>
        <h1>todos</h1>
        <ul>{todoLists}</ul>
      </div>
    );
  }
}
export default TodoList;
